package org.springframework.cglib.proxy;

import java.lang.reflect.Method;

public class LazyLoaderExample {

    public static void main(String[] args) throws Exception {
        LazyLoader lazyLoader = new LazyLoader() {
            @Override
            public Object loadObject() throws Exception {
                // The object that should handle the method invocation
                return new MyObject();
            }
        };

        // Assuming MyProxyClass is a proxy class generated by CGLIB
        MyProxyClass proxy = (MyProxyClass) Enhancer.create(MyProxyClass.class, lazyLoader);

        // The first method call will trigger the loadObject() method
        proxy.someMethod();
    }

    static class MyObject {
        public void someMethod() {
            System.out.println("Method invocation handled by MyObject");
        }
    }
}

public static final LazyLoaderGenerator INSTANCE = new LazyLoaderGenerator();
private static final Signature LOAD_OBJECT = TypeUtils.parseSignature("Object loadObject()");
private static final Type LAZY_LOADER = TypeUtils.parseType("org.springframework.cglib.proxy.LazyLoader");
@Override
public void generate(ClassEmitter ce, Context context, List methods) {
    Set indexes = new HashSet();
    for (Iterator it = methods.iterator(); it.hasNext(); ) {
        MethodInfo method = (MethodInfo) it.next();
        if (TypeUtils.isProtected(method.getModifiers())) {
            // ignore protected methods
        } else {
            int index = context.getIndex(method);
            indexes.add(index);
            CodeEmitter e = context.beginMethod(ce, method);
            e.load_this();
            e.dup();
            e.invoke_virtual_this(loadMethod(index));
            e.checkcast(method.getClassInfo().getType());
            e.load_args();
            e.invoke(method);
            e.return_value();
            e.end_method();
        }
    }
    for (Iterator it = indexes.iterator(); it.hasNext(); ) {
        int index = ((Integer) it.next());
        String delegate = "CGLIB$LAZY_LOADER_" + index;
        ce.declare_field(Constants.ACC_PRIVATE, delegate, Constants.TYPE_OBJECT, null);
        CodeEmitter e = ce.begin_method(Constants.ACC_PRIVATE | Constants.ACC_SYNCHRONIZED | Constants.ACC_FINAL, loadMethod(index), null);
        e.load_this();
        e.getfield(delegate);
        e.dup();
        Label end = e.make_label();
        e.ifnonnull(end);
        e.pop();
        e.load_this();
        context.emitCallback(e, index);
        e.invoke_interface(LAZY_LOADER, LOAD_OBJECT);
        e.dup_x1();
        e.putfield(delegate);
        e.mark(end);
        e.return_value();
        e.end_method();
    }
}
private Signature loadMethod(int index) {
    return new Signature("CGLIB$LOAD_PRIVATE_" + index, Constants.TYPE_OBJECT, Constants.TYPES_EMPTY);
}
