public class RouteExample {
    public static void main(String[] args) {
        Object[] delegates = {new ServiceImpl1(), new ServiceImpl2()};
        Route route = new Route(delegates);

        // Assuming the Route class has a method to get the delegate for a given interface
        Service service = (Service) route.getDelegate(Service.class);
        service.execute();
    }
}

class ServiceImpl1 implements Service {
    public void execute() {
        System.out.println("ServiceImpl1");
    }
}

class ServiceImpl2 implements Service {
